import axios from 'axios';
class Updateservice {
getpatientbyid(id,token){
        let response = axios.get(`http://localhost:9082/api/patientDetails/${id}`,{
            headers:{
                'AUTHORIZATION': `Bearer ${token}`
            }
        });
        return response;
    }

}
export default Updateservice;
